import "bootstrap/dist/css/bootstrap.min.css";
import '../Styles/ChatComp.css';
import { Avatar } from "@mui/material";
import { ChatBox, ReceiverMessage, SenderMessage } from "mui-chat-box";
import TextField from '@mui/material/TextField';
import { useState } from "react";
import Button from "@mui/material";
import SendIcon from '@mui/icons-material/Send';
function ChatComp(){
    const [text,setText] = useState("bla bla")
    return(
        <div >
            <ChatBox>
                <ReceiverMessage avatar={<Avatar>KS</Avatar>}>
                    Hello how are you?
                </ReceiverMessage>
                <SenderMessage avatar={<Avatar>NA</Avatar>}>
                    I'm good thanks you?
                </SenderMessage>
                <ReceiverMessage avatar={<Avatar>KS</Avatar>}>
                    I'm good too!
                </ReceiverMessage>
            </ChatBox>
            <div>
                <TextField id="standard-basic" label="Standard" variant="standard" value={text} onChange={(target)=>{
                    console.log(target.target.value)
                    setText(target.target.value)
                }}/>
                <Button variant="contained" endIcon={<SendIcon />}>
                    Send
                    </Button>
            </div>
        </div>
    );
}

export default ChatComp;
